import React from 'react'
import "./Userpage.css"

function Userpage() {
  return (
 <div className="user-main">
  <div></div>
  <h1 className='hed-user'>Users</h1>
  <div className="input-search">
    <input type="text" placeholder='Search' />
  </div>
 </div>
  )
}

export default Userpage;
